  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains information on acoustic
  recordings of cetaceans collected from areas within the Pacific Islands Region since
  2006. In collaboration with researchers at the Scripps Institution of Oceanography
  and the PIFSC EOD, the Cetacean Research Program (CRP) currently uses bottom-mounted
  data recorders called High-frequency Acoustic Recording Package or HARPs - to  conduct
  passive acoustic monitoring studies. The HARP dataloggers are moored to the sea
  bottom and remain there for an extended period of time (e.g., 6 mos. to 1 yr.).\",\n\t\"owner_org\":
